{"@type":"/cosmos.gov.v1beta1.TextProposal","description":"There are countless questions about "until when the great many of the pre-seed and seed round's Luna Tokens will be released?" from small investors in korea and this becomes the FUD about price drop (caused by the dumping of the pre-seed and seed round investors, which will not happen) continues to spread over the time, causing existing cryptocurrency traders to continue to be reluctant to enter.
If all pre-seed and seed round's Luna tokens are released at once and show there is no drop in price and the staking of Luna Tokens by pre-seed, seed investors continues, as has been the case with the ATOM, small holders and small traders are expected to continue to believe in the Terra Project and continue to stake, hold their Luna Tokens and even want to buy more, which would lead proper value of Luna Tokens.

Or if many of investors really just want to sell their tokens, not interested in what Terra has done, it would be better to allow them to sell early and let them go away from Terra Project, and give chances to small investors to buy Luna cheaper, not with concern about dumping but with a fresh start.","title":"Unlocking the pre-seed, seed round's Luna Tokens at once."}

