PLEASE SUPPORT this proposal, cause that’s the only way to recover from situation… LUNA still has a great fast, decentralised blockchain with proof of stake that is needed. People won’t buy UST again. Coordinating strengths on UST and dumping LUNA is just a waste of time and money!","title":"SAVE LUNA! DON’T FOCUS ON UST! "}

