{"@type":"/cosmos.gov.v1beta1.TextProposal","description":"UST needs to be thought of as a debt owed by Luna Holders.  If the debt is never going to be satisfied, then Luna is likely doomed to fail as too much money has been sucked out of the system and too many lives have been ruined from the depeg of a "stable asset."   The Luna "Ecosytem" that everyone wants to save IS premised on UST existing and that trust must be restored.  There is no sense saving an "ecosystem" that is just another random coin with little use case and a failed trust.

So, a tax 15% on all Luna transactions should be implemented.  Of that tax, 7.5% should be burnt to help Luna supply correct and 7.5% should go to a pool that is paid equally to all UST Holders of record once daily. This way, there is now an extra incentive to hold UST and a way to add value to it.  This value increase should allow it to slowly repeg as it should.  

Ongoing, Luna will only earn stake yield when UST is pegged.  Anytime a depeg of over 3% occurs, this system can go back into place.  This should help stabilize the system.  ","title":"UST Yield / Luna Burn to Restore System"}

