{"@type":"/cosmos.gov.v1beta1.TextProposal","description":"New contract that would allow anyone holding Native Terra Luna tokens to convert from Terra V1 to Terra V2. �All buys and sells of Terra Luna would be subject to a 10% tax. �Of that 10%, 4% would be redistributed to any holder of native Terra Luna prior to March 9th. �Anyone that bought on March 9th or after would not be eligible for this 4% redistribution. �This would be determined by taking a snapshot of the blockchain on that day. �

3% would go towards burning the supply which would start at 1T Luna Coins at the genesis of the contract and would continue until the supply reached a 100M. �

The remaining 2% would be split 50/50 going to both the Terra team and to a liquidity pool. �This would also be the case for the 2% wallet to wallet transfer fee. �","title":"10% Transaction Fee on Buys/Sells 2% Wallet Transfer Fees"}

