{"@type":"/cosmos.gov.v1beta1.TextProposal","description":"On April 30, a meeting was convened between Do Kwon and Terra's rich shareholders (better known as "whales"). What was so strange about this meeting wasn't that it capped off a spending spree -- where the Luna Foundation Guard bought BTC with inflated UST and LUNA assets -- it was that it directly preceded the dissolution of both arms of Terraform Labs Corporation in Korea, which happened ON THE SAME DAY OF KWON'S MEETING WITH TERRA SHAREHOLDERS. I first learned about this in an article published by Coindesk, but later confirmed it in a report by the South Korean newspaper Korea JoongAng Daily -- which made the claim after reviewing Supreme Court documents regarding the dissolution.


Besides defending the American investors who held LUNA & UST, I felt it was important to honor the 280,000 Korean investors in the Terra platform who have lost in excess of $40 billion USD on a project that was so clearly flawed from the beginning. Like many other LUNAtics, I guess I got carried away with the project and decided to overlook the red flags that are so visible now. All things stated, it is important for you to abandon this project immediately before you lose any more money. Korean police have launched an investigation against a Luna Foundation Guard employee who is said to have embezzled assets once the precipitous decline of LUNA and UST began. Terra is dead, and Do Kwon should be investigated for defrauding millions of people around the world -- like you and me. You have been warned.
","title":"Investigate Do Kwon For Fraudulent Activity Leading Up To The Terra's Fall"}

